import React from "react";
import { Button } from "react-bootstrap";
import Header from "../../Components/Header/Header";
import "./Hero.css";
import data from "./data.json";

export default function Hero() {
  return (
    <div className="hero">
      <Header />
      <img src="./assets/coin.png" className="coin" />
    </div>
  );
}
